import React, { Component } from 'react'
import { Fragment } from 'react'
import dataCar from "../carsData/carsData.json";


export class CarSignleAudi1 extends Component {






    render() {


        /* Set the width of the side navigation to 250px and the left margin of the page content to 250px and add a black background color to body */
        function openNav() {
            this.getElementById("mySidenav").style.width = "250px";
            this.getElementById("main").style.marginLeft = "250px";
            this.body.style.backgroundColor = "rgba(0,0,0,0.4)";
        }

        /* Set the width of the side navigation to 0 and the left margin of the page content to 0, and the background color of body to white */
        function closeNav() {
            this.getElementById("mySidenav").style.width = "0";
            this.getElementById("main").style.marginLeft = "0";
            this.body.style.backgroundColor = "white";
        }

        return (
            <Fragment>
                <div className="container mb-5 mt-5">
                    <div className="row">
                        <img className="col-lg-5" src={dataCar[0].img} alt={dataCar[0].name} />
                        <div className="col-lg-7">
                            <p>Model : {dataCar[0].Model}</p>

                            <h2>{dataCar[0].name}</h2>
                            <h4>{dataCar[0].price}</h4>
                        </div>
                    </div>

                </div>
            </Fragment>
        )
    }
}

export default CarSignleAudi1
